import './App.css';

function App() {
  return (
    <menu className="App">
      <li><a className='item' href='#'>Goods</a></li>
      <li><a className='item' href='#'>Discount</a></li>
      <li><a className='item' href='#'>Contacts</a></li>
      <li><a className='item' href='#'>Cart</a></li>
    </menu>
  );
}

export default App;
